// Set the following variables with the name of your import set table and task id column (to be changed to use properties)  
// var importSetTableName = gs.getProperty('Record_Producer_ImportSetTable_Company');  
var importSetTableName = "x_133853_customer_record_producer_importsettable_company";
//var importSetTaskIDFieldName = "task_id";   
// var transformMapID = gs.getProperty('TransformMap_SysID_Company');
var transformMapID = "fe0be933db2f030043055740cf9619dc";

// Setup data source for attachment
gs.info("[Customer Onboarding][RP][Company] Setup data source with Attachment settings");
current.name = "[DCF] Customer Onboarding - Bulk Company load";  
current.import_set_table_name = importSetTableName;  
current.file_retrieval_method = "Attachment";  
current.type = "File";  
current.format = "Excel";  
current.header_row = 11;  
current.sheet_number = 3;  
current.insert(); 
gs.info("[Customer Onboarding][RP][Company] Data Source Configured.");
gs.addInfoMessage("Data Source Configured."); 

// Process excel file into Data Source using ScopedTools utility (Required because of cross scope permissions blocking needed API) 
var tools = new global.ScopedTools();
var importSetRec = tools.Process_Attachment(current);
gs.addInfoMessage("Import Set Created.");

if (importSetRec.isValidRecord() == true){
	// Run transform for built import set using predefined transform map 
	tools.Transform(importSetRec.sys_id, transformMapID);
	gs.addInfoMessage("Transform Started.");
	gs.addInfoMessage("Data import may take time load, please reload the list.");
} else {
	// Something went wrong, we need to abort
	gs.addErrorMessage("Error: An import set was not created. Please review the Application logs for further information.");
	current.setAbortAction(true);
}

